import React from 'react';
import { Route, Switch } from 'react-router-dom';
import Selection from '../components/selection/Selection';

const Homepage: React.FC = () => {
  return (
    <div>
      <Switch>
        <Route exact path="/" component={Selection} />
      </Switch>
    </div>
  );
};

export default Homepage;
